create table person (
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	date_of_birth DATE,
	country_of_birth VARCHAR(50),
	sex_at_birth VARCHAR(8),
	sex VARCHAR(8),
	gender_identity VARCHAR(11),
	gender_expression VARCHAR(11),
	pronouns VARCHAR(9),
	education_level VARCHAR(19),
	email VARCHAR(50),
	phone_number VARCHAR(50)
);
